import React from 'react';
import { Checkbox } from 'antd';
import { DeleteOutlined } from 'antd'







const Task = (props) => {
  return (
    <Checkbox>
      {props.task}
      <button><DeleteOutlined /></button>

    </Checkbox>
  );
}

export default Task;
